```go
package main

import (
	"fmt"
	"net"
	"sync"

	"github.com/miekg/dns"
)

var (
	ipsMap   = make(map[string][]string)
	ipsMutex = sync.Mutex{}
)

func handleRequest(w dns.ResponseWriter, r *dns.Msg) {
	m := new(dns.Msg)
	m.SetReply(r)

	for _, q := range r.Question {
		ipsMutex.Lock()
		ips, found := ipsMap[q.Name]
		ipsMutex.Unlock()

		if !found {
			ips = []string{}
			ipsMutex.Lock()
			ips = forwardDNS(q.Name)
			ipsMutex.Unlock()
		}

		answer := &dns.A{
			Hdr: dns.RR_Header{
				Name:   q.Name,
				Rrtype: dns.TypeA,
				Class:  dns.ClassINET,
				Ttl:    300,
			},
			A: ips,
		}
		m.Answer = append(m.Answer, answer)
	}

	w.WriteMsg(m)
}

func forwardDNS(name string) []string {
	ips := []string{}
	for _, server := range []string{"8.8.8.8:53", "1.1.1.1:53"} {
		conn, err := net.Dial("udp", server)
		if err != nil {
			continue
		}
		defer conn.Close()

		msg := new(dns.Msg)
		msg.SetQuestion(dns.Fqdn(name), dns.TypeA)
		msg.RecursionDesired = true

