namespace App\Http\Middleware;

use Closure;
use Illuminate\Support\Facades\Auth;

class CheckFirebaseAuth
{
    public function handle($request, Closure $next)
    {
        if (!Auth::check()) {
            $firebaseIdToken = $request->header('Authorization');

            if ($firebaseIdToken) {
                try {
                    $decodedToken = FirebaseAuth::verifyIdToken($firebaseIdToken);

                    if ($decodedToken) {
                        $user = User::where('firebase_id', $decodedToken->uid)->first();

                        if ($user) {
                            Auth::login($user);
                        }
                    }
                } catch (Exception $e) {
                    // Handle error
                }
            }
        }

        return $next($request);
    }
}
